port: 7890
socks-port: 7891
mixed-port: 10801
redir-port: 7892
tproxy-port: 7893
allow-lan: true
bind-address: "*"
find-process-mode: strict
mode: rule
secret: ""
unified-delay: false
tcp-concurrent: true
geodata-mode: false
skip-auth-prefixes:
    - 127.0.0.1/32
authentication: []
lan-allowed-ips:
    - 0.0.0.0/0
    - ::/0
lan-disallowed-ips: []
geox-url:
    geoip: "https://fastly.jsdelivr.net/gh/MetaCubeX/meta-rules-dat@release/geoip.dat"
    geosite: "https://fastly.jsdelivr.net/gh/MetaCubeX/meta-rules-dat@release/geosite.dat"
